import React from 'react';
import { 
    AboutContanier,
    AboutWrapper,
    AboutHeading,
    AboutTextContainer,
    AboutText
} from './About.elements';

const About = () => {
    return(
        <AboutContanier>
            <AboutWrapper>
                <AboutHeading>The Peakprime Journey</AboutHeading>
                    <AboutTextContainer>
                        <AboutText></AboutText>
                    </AboutTextContainer>
                    <AboutText>
                        Why build another marketing tool? There are many reasons, but the main one is that setting up marketing campaigns that really support the sales team is still a hassle, despite all the tech out there.
                        With Outfunnel, you can automate your email marketing, unify your sales and marketing data, prioritize your hottest leads, and get insights to optimize your marketing ROI.
                        Our team members are experienced marketers, sales operators and developers from companies like Pipedrive, The Next Web, Amazon, Lingvist, Bang&Olufsen and Skype.
                        We are backed by byFounders, Paua Ventures and a fine group of angel investors. We’re based in Tallinn, Estonia from where we’re serving businesses around the world.
                    </AboutText>
            </AboutWrapper>
        </AboutContanier>
    );
}

export default About;
